import React, { useState } from 'react'
import { Button, Row, Col, Container, Card, FormGroup, Input } from 'reactstrap';
import WishItem from './WishItem';

const BloodWishList = ({bloodList, checkedItemHandler}) => {
    console.log('bloodList', bloodList);

        //하나의 체크박스 관리
        const [bChecked, setChecked] = useState(false)
        const checkHandler = ({target})=>{
            setChecked(!bChecked)
            checkedItemHandler((bloodList.id, target.checked))
        } 

  return (
    <div>
        <h5>혈관/혈행흐름개선</h5>

        <FormGroup>
        <Container>
            <Row className="m-t-40 justify-content-center">
        {bloodList.map((item)=>(
                <WishItem item={item}/>
        ))}
        </Row>
        </Container>
        </FormGroup>
    </div>
  )
}

export default BloodWishList
